import { NavLink, useNavigate } from "react-router-dom";
import styles from "./styles.module.css";

const Navigation = () => {
    const navigate = useNavigate(); // Corrected useNavigate instead of Navigate

    const handleLogout = () => {
        navigate("/login"); // Redirect to home on logout
    };

    return (
        <div className={styles.nav_links_container}>
            <nav className={styles.navbar}>
                {/* Left Section with Logo */}
                <h1 className={styles.nav_logo}>WealthWise</h1>

                {/* Right Section with Navigation Links and Logout Button */}
                <div className={styles.nav_links_container}>
                    <div className={styles.nav_links}>
                        {/* Dashboard Link */}
                        <NavLink
                            to="/"
                            className={({ isActive }) =>
                                isActive ? `${styles.nav_link} ${styles.active}` : styles.nav_link
                            }
                        >
                            DashBoard
                        </NavLink>

                        {/* Income Link */}
                        <NavLink
                            to="/Income"
                            className={({ isActive }) =>
                                isActive ? `${styles.nav_link} ${styles.active}` : styles.nav_link
                            }
                        >
                            Income
                        </NavLink>

                        {/* Expenses Link */}
                        <NavLink
                            to="/Expenses"
                            className={({ isActive }) =>
                                isActive ? `${styles.nav_link} ${styles.active}` : styles.nav_link
                            }
                        >
                            Expenses
                        </NavLink>

                        {/* Saving & Investment Link */}
                        <NavLink
                            to="/savingsinvestment"
                            className={({ isActive }) =>
                                isActive ? `${styles.nav_link} ${styles.active}` : styles.nav_link
                            }
                        >
                            Saving & Investment
                        </NavLink>
                    </div>

                    {/* Logout Button */}
                    <div className="login-bar">
                        <p className={styles.logoutBar}>|</p>
                    </div>
                    <button className={styles.white_btn} onClick={handleLogout}>
                        Logout
                    </button>
                </div>
            </nav>
        </div>
    );
};

export default Navigation;
